      <div className="image-container">
        {/* Add your image source */}
        <img src="images/joinus.jpg" alt="Profile" />
      </div>
      <div className="content-container">
        <h1>About Me</h1>
        <p>
          {/* Add your content here */}
          Department of Earth and Planetary Sciences  at Jackson School of Geosciences
UT Extreme Weather and Urban Sustainability (TExUSLab.org) Lab || UT-City CoLab (UTCityCoLab.org)
William Stamps Farish Chair Professor and UNESCO Chair in AI, Water, and Cities


Affiliate Faculty: 
