Oden Institute of Computational Engineering and Sciences, UT Center for Space Research, 
Energy, and Earth Resources  (EER) graduate program, The University of Texas at Austin
(Also,  former State Climatologist and Professor Emeritus, Purdue University)
        </p>
      </div>
    </div>
  );
};

export default AboutMe;
